import React from 'react';
import './GuestPage.css';
const GuestPage = () => {
  return (
    <div className="GuestChatContainer">
      <div className="roomColumn">Current Rooms</div>
      <div className="chatColumn">Column 2</div>
      <div className="userColumn">Column 3</div>
    </div>
  );
};

export default GuestPage;
